    (ROV) outfitted with video equipment (and other devices) was deployed fromthe NOAA
    Ship McAurthurII during May-June 2006 in an attempt to document the presence of
    critical hard bottom benthic habitats believedto exist in the waters of the Olympic
    Coast national marine sanctuary (OCNMS). Video data from specific dives falling
    withinthe bounds of the HMPR-119-2006-01a survey area were reviewed to describe
    various benthic characteristics as a tool for validating sonar imagery.",nt"license_title":
